import React from 'react';
import CenterItem from './CenterItem';
import './Centers.css';
import img1 from '../images/img-1.jpg'
import img2 from '../images/img-2.jpg'
import img3 from '../images/img-3.jpg'
import img4 from '../images/img-4.jpg'
import img5 from '../images/img-5.jpg'
import { useState } from 'react';


const center_img_list = [img1, img2, img3, img4, img5];
const center_name_list = ['스포애니 관악점', '파크짐 동대문점', '엠비휘트니스', '을지휘트니스', '파고다헬스클럽'];
const center_price_list = ["250,000KRW/MONTH", '120,000KRW/MONTH', '70,000KRW/MONTH', '140,000KRW/MONTH', '90,000KRW/MONTH'];
const center_label_list = ['관악구', '동대문', '신당동', '을지로', '수표로'];

export default function Center_list(){
        let [center_img, change_img] = useState(img1);
        let [center_name, change_name] = useState('스포애니 관악점');
        let [center_price, change_price] = useState("250,000KRW/MONTH");
        let [center_label, change_label] = useState('관악구');

function Create_Center(){
    for (let i = 0 ; i < center_label_list.length ; i++){
        let copy_img = center_img_list[i];
        let copy_name = center_name_list[i];
        let copy_price = center_price_list[i];
        let copy_label = center_label_list[i];
        change_img(copy_img);
        change_name(copy_name);
        change_price(copy_price);
        change_label(copy_label);
        return <CenterItem src= {center_img} text= {center_name} text2={center_price} label= {center_label} path='/services' />
      } 
    }

function Centers() {
    return(
        <>
        <div>
            <h1>우리동네 헬스장을 찾아보세요!</h1>
        </div>
        <div className='center__main__div'>
            <ul className='centers__items'>
               {Create_Center}
            </ul>
        </div>
        </>
    )
    } 
Centers();       
}    

